import React, { Component } from 'react';
import './App.css';
import Customer from './component/customer/customer'
import Header from './component/header'

class App extends Component {
  render() {
    return (
      <div className="App">
      <h2>header in the page</h2>
       <Customer />
      </div>
    );
  }
}

export default App;
